+----------------+
|Game Description|
+----------------+

Solve the secrets of the ancient amulet to save the world from cataclysmic disaster! Help Diana and Carrie navigate crumbling Mayan pyramids and powerful priests to find objects and solve riddles in this casual hidden object adventure!

+----------------------------------+
|Instructions / System Requirements|
+----------------------------------+

No install or crack is required for this portable version. Extract the ZIP file and create a shortcut to the executable (EXE) to play.

- Operating system: Windows XP/Vista/7

- Processor speed: 600 MHz

- RAM: 256 MB

- Graphics Card: 64 MB

- DirectX version: 9.0c

